import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Home from "./home";
import HomeLogin from "./home-login";
import Tour from "./detail-tour";
import Profile from "./components/profile"
import Payment from "./payment"
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Add from "./add-trip"
import Admin from './home-admin'


ReactDOM.render( 
    <React.StrictMode >
    <BrowserRouter>
        <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path ="/home-login" component={HomeLogin} />
        <Route exact path ="/home-admin" component={Admin} />
        <Route exact path ="/detail-tour/:id" component={Tour} />
        <Route exact path ="/profile" component={Profile} />
        <Route exact path ="/payment" component={Payment} />
        <Route exact path ="/add-trip" component={Add} />
        </Switch>
    </BrowserRouter>,
    </React.StrictMode>,
    document.getElementById("root")
);
